import Navbar from './Navbar';
import styles from './Scraper.module.css';
import React from 'react';

const Scraper = () => {
  	return (
    		<div className={styles.scraper}>
                <Navbar />
                <div className={styles.crimewatch}>crimewatch</div>
      			<div className={styles.whichWebsiteWould}>which website would you like to check?</div>
        				<div className={styles.keywords}>keywords:</div>
                        <div className={styles.rectangleDiv} />
        				<div className={styles.flagged}>flagged</div>
        				<div className={styles.www8chancom}>www.8chan.com</div>
        				<div className={styles.wwwredditcom}>www.reddit.com</div>
        				<div className={styles.wwwmothershipcom}>www.mothership.com</div>

        				<div className={styles.scraperInner} />
        				<div className={styles.scraperChild1} />
        				<div className={styles.rectangleParent}>
          					<div className={styles.groupChild} />
          					<div className={styles.run}>run</div>
        				</div>
        				</div>);
};

export default Scraper;
